CREATE PROCEDURE dbo.proc_transform_88
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_88
    SET payload = LEFT(payload, 1000) + N'|V4-88|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_88;
END
